import './App.css';

function App() {
  const name = "RAMA";
  const email = "adit@ramp.com";

  const hname = <h1> name</h1>;
  const hemail = <h2> name</h2>;

  const user = (
    <div>
      {hname}
      {hemail}
    </div>
  );
  return (
    <div className="App">
      {user}
      {user}
      {user}
    </div>
  );
}

export default App;
